webpackJsonp([23015201110121],{5768:function(e,t){e.exports={data:{post:{html:"<p>Thursday was the deadline for the employees to agree to the salary cuts proposed by my employer. Management had said that only with 90% agreement could lay-offs be avoided. I didn't catch the final figures, but at best only 75% are on board. The mood is one of awaiting the inevitable. I've never had so much quiet at work. I'm getting more done than ever.</p>",fields:{title:"Seventy-five Percent",date:"12 Oct 2002",url:"https://papascott.de/2002-10-12-seventy-five-percent/"}}},pathContext:{slug:"/2002-10-12-seventy-five-percent/",prev:{fields:{title:"OpenOffice",date:"11 Oct 2002",slug:"/2002-10-11-openoffice/"}},next:{fields:{title:"The Disadvantage of Sidebars",date:"13 Oct 2002",slug:"/2002-10-13-the-disadvantage-of-sidebars/"}}}}}});
